class Solution {

    /**
     * @param Integer[] $numbers
     * @param Integer $target
     * @return Integer[]
     */
    function twoSum($numbers, $target) {
        //find the value less then target value        
        for($i=0; $i < count($numbers); $i++){
            if($numbers[$i] <= $target){
                $secondElement = $target - $numbers[$i];               
                $seconsdElementIndex = array_search($secondElement, $numbers);
                if(($seconsdElementIndex = array_search($secondElement, $numbers)) !== false){
                    if(intval(++$i) === intval(++$seconsdElementIndex)){
                        $seconsdElementIndex = $seconsdElementIndex + 1;
                    }
                    return $IntegerArr = [$i, $seconsdElementIndex];
                }
            }
        }
        return $IntegerArr = [1,2];
    }
}
